import React,{useState,useEffect} from "react";
import axios from "axios";

export default function PersonFList () {
    const [users,setUsers] = useState([])
    useEffect (() =>{
        axios.get('https://jsonplaceholder.typicode.com/user/1').then(req=>{
            const dadosUsers=req.data
            setUsers(dadosUsers)
        })
    })
    return(
        <div>
            {users.map(
                item => <div>{item.data.name}</div>
            )}
        </div>
    )
}
